import React from 'react';
import "./Map.css";

import express from 'express';
import cors from 'cors';

const app = express();
app.use(cors())

function Map() {

  const url = `https://www.google.com/maps/embed/v1/view?key=AIzaSyABk8ivIGBo2a6Q56fFZ2rKpeBZEi6XtCA&center=44.764409,-93.279372&zoom=20&maptype=satellite`;


  const clickMe = () => {
    console.log('here is my EMBED_GOOGLE_API_KEY', process.env.EMBED_GOOGLE_API_KEY);

  }
  return (
    <div className="row w-100">
      <iframe
        title="unique title"
        width="100%"
        height="600"
        frameborder="0"
        src={url}
        allowfullscreen>
      </iframe>
      <button onClick={clickMe}>hi</button>
    </div>
  );
}

export default Map;
